import { motion } from "framer-motion";
import Navbar from "./components/Navbar";
import FileUpload from "./components/FileUpload";
import LatencyCard from "./components/LatencyCard";
import SessionHistory from "./components/SessionHistory";
import Footer from "./components/Footer";

export default function App() {
  return (
    <motion.div
      className="min-h-screen flex flex-col items-center justify-start bg-gradient-to-br from-[#0b0f1a] via-[#11172b] to-[#1c1234] text-white"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.8, ease: "easeOut" }}
    >
      {/* NAVIGATION */}
      <Navbar />

      {/* MAIN CONTENT */}
      <main className="app-content w-full flex flex-col items-center justify-center px-4 sm:px-8 md:px-16">
        <h1 className="text-4xl sm:text-5xl font-extrabold title-gradient text-center mt-4 mb-2">
          Synaptra Core v3.0
        </h1>
        <p className="text-gray-400 text-center mb-10 text-sm sm:text-base">
          Multimodal Embodied AI Agent â€” bridging Vision, Audio, Reasoning & Action.
        </p>

        <div className="flex flex-col sm:flex-row items-center justify-center gap-8 w-full max-w-5xl">
          <FileUpload />
          <FileUpload />
        </div>

        <LatencyCard />
        <SessionHistory />
      </main>

      {/* FOOTER */}
      <Footer />
    </motion.div>
  );
}
